  const list = results && results.map(villager => 
    <li key={villager.id}>
      <Link to={`/villagers/${villager.id}`} className="link"> 
        {villager.name} 
        <img src={add} alt="add villager to island" onClick={() => handleAdd(villager.id, island.id)}/>
      </Link>
    </li>)
  return (
    <>
      {list}
    </>
  )
}

export default SearchResults;

